(21137, 'E473CE0F-FEEF-4FA5-9498-7A15E5E62748', 'Nutrisource Small and Medium Breed Puppy  () you can cook up chicken and used a little of the broth on the food and a little finely chopped chicken, or buy Iam''s or Purina Pro Plan puppy food and use very small amount to coat dry kibble two ce a day. Can keep dry kibble available all day for snacking.  Disposal pee pads or washable pee pads( can use crib pads also)  Playpen - I buy the Iris 4 sided white or black one that''s easy to put together  Playpen large floor pad(Amazon)  They come size of playpen, and they are tan color  Medium crate  Small collar- Walmart, $1.86 or cloth style harness  Not nylon harness.  Chew treats. I like pork rind ones like the O''Roy logs . They are just pork rinds. Nothing else. But they don''t chew them up quickly. They chew and chew and chew forever on them. Eventually they get a tiny bit soft and they eat a tiny bit. But not a lot at once. Have not had any trouble. They love the Good and fun wrapped in chicken. They do have some colors in them, which I don''t like, but they have never gotten diarreah from them . I have had huge triuble w  diarreah  w the ones that are rawhide free!', 'Nitzan', 'David', '2021-02-06T19:14:59.745427'),
