(21231, 'ADE3FCEB-A7BE-455C-A0C7-16E3F540B291', 'I️ don’t know how you are feeling right now, but I️’m spinning in a downward cycle. I️ have mean thoughts and snarky things I️ want to say. I️’m sure you’re not feeling too hot about me either. Instead of writing a hostile note, I️’m just sharing that I️’m not doing great right now. I️ feel like I️ have to state a scope of work that needs constant approval from you and unless I️ do that over and over again, there’s no other discussion that is warranted. And I️ feel like I️ have a gun to my head. Both of those things are not great conditions for doing non defensive work. I️ felt like we got really far this weekend and I️ felt disarmed. And now I️ just feel like my defenses are back up again. I️’m trying hard to push through them because I️ know I️ have work to do and I️’m not trying to create distractions for myself. But I️ feel terrible inside. And instead of taking it out on you and being mean, I️ am just telling you what’s happening in my throat and my body.', 'Nitzan', 'David', '2021-02-10T08:54:37.346215'),
(21232, '89EDD5F4-A4BC-422F-9585-2C3B7D54FC87', 'Thank you for sharing how you are feeling and not lashing out. I want to give you a hug and help you relax. I’m not feeling great either and there is more we can unpack with Priscilla tomorrow. This is hard and exhausting and sometime frustrating work. And through it...there are going to be times when we don’t see eye to eye...and that is okay. But I’m here, I love you to death and I too want to create conditions where we both feel safe to be honest and transparent with each other...we are both flawed and we can work through the hard stuff. I feel sad...but hopeful. We are going to get through this. Our bond and our love is strong. I love you my dear.', 'David', 'Nitzan', '2021-02-10T09:28:37.184622'),
(21240, '7F554462-5DCA-4197-B456-4F793A13B858', 'love. I finished your Valentine’s Day song. Was planning to share it with you this weekend...but if there is a time beforehand when you would like me to play it for you...you just tell me when.', 'David', 'Nitzan', '2021-02-10T13:02:31.459000'),
