(21553, '4FAB3D2C-08DE-40E4-BBFA-9C87985FC1D0', 'Love, I’m feeling a bit tired and sad today....not sure why about the sad. I appreciate you telling me you are going to talk to Mike. I did receive it with a feeling of fear. It would have felt better to me if instead of telling me about something you had already planned, you had checked in and asked me. I know we don’t have any formal agreement here, and you didn’t do anything wrong, but I’m fighting against a negativity bias of being an afterthought. Just wanted to share. I do have further thoughts about your relationships with Mike and Joe that I’d like to share when we have time to discuss.', 'David', 'Nitzan', '2021-02-19T12:06:13.654000'),
(21554, '2DBE1190-E97C-4333-B7D1-65CA581EDCE2', 'Thanks for letting me know love. I’ve also been feeling really sad this morning.', 'Nitzan', 'David', '2021-02-19T12:06:53.006570'),
(21555, '20EC63F3-57B6-4114-A216-08206FC94E30', 'I️ woke up this morning wondering about OK Cupid and just because I️ was feeling really curious, I️ logged onto my OKCupid account for the first time in months. I️ logged on to to see if you were on it and it looks like you have been this week. I️ am confused because I’m not sure what we are and aren’t saying to each other, but I️ thought you would have talked to me about it.', 'Nitzan', 'David', '2021-02-19T12:09:03.387614'),
(21556, 'F6895A3C-27F4-4462-B07C-F113846D5EB7', 'That’s why I️ brought up saying that I️ was going to talk to Mike -- because I️ wanted to be more transparent -- which is what I️ thought we were trying to do more of.', 'Nitzan', 'David', '2021-02-19T12:09:52.209484'),
(21557, '8F773F79-6A6A-45DB-BDDA-B9FFA022ABD9', 'I️ haven’t had any contact with him other than the 3 minute call the day you wrote to him.', 'Nitzan', 'David', '2021-02-19T12:10:11.493132'),
(21558, '9F9D3D91-A4A4-4586-B785-24751A77C88A', 'And I️ reached out to him this morning for the first time.', 'Nitzan', 'David', '2021-02-19T12:10:34.563020'),
(21559, '31D651B3-5CDA-4F2C-B6E9-6B66FB01AAF9', 'And if I’m being honest, I️ did that in part because I️ was feeling hurt.', 'Nitzan', 'David', '2021-02-19T12:11:01.216296'),
(21560, '6FC3B37E-3B9E-445D-B678-E6483FFB46FC', 'You are not an after thought. I️ told you about Mike within the same hour I️ reached out to him. I️ guess it’s ok to talk about it before hand too, but I️ don’t see any of this being an after thought. But sometimes, I️ feel like when you are fearful, you also make me an after thought. Like how can you be ok OK Cupid again without talking to me about it after everything that’s happened...So now I’m just really confused.', 'Nitzan', 'David', '2021-02-19T12:13:05.419750'),
(21561, '929AEF8A-5571-4929-A0AA-408E39BCC071', 'I’m not a body feeling person, but my whole body is shaking.', 'Nitzan', 'David', '2021-02-19T12:16:44.003092'),
(21562, '67200323-F6A9-4682-BF70-A587FD370960', 'I️ guess my question is whether it feels like an after thought to tell someone what you are doing the day of or within a short window of time, or if the only way it doesn’t feel like an after thought is if you talk about it ahead of time.', 'Nitzan', 'David', '2021-02-19T12:17:31.570616'),
(21563, 'A41D8E02-5FFC-4EE4-9377-06C46842AB65', 'Based on our understandings, I️ didn’t think I️ was expected to talk to you about talking with Mike and that we were without any agreements -- which even includes sexting. I️ just haven’t done any of that because quiet frankly, I️ haven’t felt any desire for it.', 'Nitzan', 'David', '2021-02-19T12:18:30.087629'),
(21564, 'E948292D-3E55-436F-B055-33C021ECC34F', 'Outside of the sexting, Mike (and Joe) are my friends. I️ sometimes feel really lonely here on zoom. And sometimes I️ also just want to connect with people who know me well. I’m happy to hear whatever feelings you have on all of this. I’m free at 1 if you happen to be free then. Otherwise, I’m going to go on a walk.', 'Nitzan', 'David', '2021-02-19T12:19:48.999771'),
